"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[92],{58820:(e,t,o)=>{o.r(t),o.d(t,{default:()=>n,johnChapter13ES:()=>s});const s={chapter:13,title:"Jean 13",version:"Reina-Valera 1909",language:"es",direction:"ltr",verses:[{number:1,text:"Antes del d\xeda de la fiesta de la Pascua, sabiendo Jes\xfas que su hora hab\xeda venido para que pasase de este mundo al Padre, como hab\xeda amado \xe1 los suyos que estaban en el mundo, am\xf3los hasta el fin.",strong:[{text:"este",strong:"G3778",start:100,end:104},{text:"mundo",strong:"G2889",start:105,end:110},{text:"Padre",strong:"G3962",start:114,end:119},{text:"como",strong:"G2531",start:121,end:125},{text:"amado",strong:"G27",start:132,end:137},{text:"mundo",strong:"G2889",start:168,end:173}]},{number:2,text:"Y la cena acabada, como el diablo ya hab\xeda metido en el coraz\xf3n de Judas, hijo de Sim\xf3n Iscariote, que le entregase,",strong:[{text:"como",strong:"G2531",start:19,end:23},{text:"hijo",strong:"G5207",start:74,end:78}]},{number:3,text:"Sabiendo Jes\xfas que el Padre le hab\xeda dado todas las cosas en las manos, y que hab\xeda salido de Dios, y \xe1 Dios iba,",strong:[{text:"Padre",strong:"G3962",start:22,end:27},{text:"Dios",strong:"G2316",start:94,end:98},{text:"Dios",strong:"G2316",start:104,end:108}]},{number:4,text:"Lev\xe1ntase de la cena, y qu\xedtase su ropa, y tomando una toalla, ci\xf1\xf3se.",strong:[{text:"table",strong:"H7979",start:11,end:16}]},{number:5,text:"Luego puso agua en un lebrillo, y comenz\xf3 \xe1 lavar los pies de los disc\xedpulos, y \xe1 limpiarlos con la toalla con que estaba ce\xf1ido.",strong:[{text:"agua",strong:"H4325",start:11,end:15}]},{number:6,text:"Entonces vino \xe1 Sim\xf3n Pedro; y Pedro le dice: Se\xf1or, \xbft\xfa me lavas los pies?",strong:[{text:"Seigneur",strong:"G2962",start:53,end:61}]},{number:7,text:"Respondi\xf3 Jes\xfas, y d\xedjole: Lo que yo hago, t\xfa no entiendes ahora; mas lo entender\xe1s despu\xe9s.",strong:[]},{number:8,text:"D\xedcele Pedro: No me lavar\xe1s los pies jam\xe1s. Respondi\xf3le Jes\xfas: Si no te lavare, no tendr\xe1s parte conmigo.",strong:[{text:"avec",strong:"G1848",start:119,end:123}]},{number:9,text:"D\xedcele Sim\xf3n Pedro: Se\xf1or, no s\xf3lo mis pies, mas aun las manos y la cabeza.",strong:[{text:"Seigneur",strong:"G2962",start:22,end:30}]},{number:10,text:"D\xedcele Jes\xfas: El que est\xe1 lavado, no necesita sino que lave los pies, mas est\xe1 todo limpio: y vosotros limpios est\xe1is, aunque no todos.",strong:[{text:"todo",strong:"G3956",start:79,end:83}]},{number:11,text:"Porque sab\xeda qui\xe9n le hab\xeda de entregar; por eso dijo: No est\xe1is limpios todos.",strong:[]},{number:12,text:"As\xed que, despu\xe9s que les hubo lavado los pies, y tomado su ropa, volvi\xe9ndose \xe1 sentar \xe1 la mesa, d\xedjoles: \xbfSab\xe9is lo que os he hecho?",strong:[{text:"mesa",strong:"H7979",start:91,end:95}]},{number:13,text:"Vosotros me llam\xe1is, Maestro, y, Se\xf1or: y dec\xeds bien; porque lo soy.",strong:[{text:"Maestro",strong:"G1320",start:21,end:28},{text:"bien",strong:"H2896",start:48,end:52}]},{number:14,text:"Pues si yo, el Se\xf1or y el Maestro, he lavado vuestros pies, vosotros tambi\xe9n deb\xe9is lavar los pies los unos \xe1 los otros.",strong:[{text:"Maestro",strong:"G1320",start:26,end:33}]},{number:15,text:"Porque ejemplo os he dado, para que como yo os he hecho, vosotros tambi\xe9n hag\xe1is.",strong:[{text:"como",strong:"G2531",start:36,end:40}]},{number:16,text:"De cierto, de cierto os digo: El siervo no es mayor que su se\xf1or, ni el ap\xf3stol es mayor que el que le envi\xf3.",strong:[{text:"siervo",strong:"G1401",start:33,end:39}]},{number:17,text:"Si sab\xe9is estas cosas, bienaventurados ser\xe9is, si las hiciereis.",strong:[]},{number:18,text:"No hablo de todos vosotros: yo s\xe9 los que he elegido: mas para que se cumpla la Escritura: El que come pan conmigo, levant\xf3 contra m\xed su calca\xf1ar.",strong:[{text:"contra",strong:"G2596",start:124,end:130}]},{number:19,text:"Desde ahora os lo digo antes que se haga, para que cuando se hiciere, cre\xe1is que yo soy.",strong:[]},{number:20,text:"De cierto, de cierto os digo: El que recibe al que yo enviare, \xe1 m\xed recibe; y el que \xe1 m\xed recibe, recibe al que me envi\xf3.",strong:[]},{number:21,text:"Como hubo dicho esto Jes\xfas, turb\xf3se en esp\xedritu, y protest\xf3, y dijo: De cierto, de cierto os digo, que uno de vosotros me ha de entregar.",strong:[{text:"Como",strong:"G2531",start:0,end:4},{text:"esto",strong:"G3778",start:16,end:20}]},{number:22,text:"Entonces los disc\xedpulos se miraban los unos \xe1 los otros, dudando de qui\xe9n hablaba.",strong:[]},{number:23,text:"Y uno de sus disc\xedpulos, al cual Jes\xfas amaba, estaba recostado en el seno de Jes\xfas.",strong:[]},{number:24,text:"A \xe9ste, pues, hizo se\xf1as Sim\xf3n Pedro, para que preguntase qui\xe9n era aquel de quien hablaba.",strong:[{text:"signe",strong:"G4592",start:21,end:26},{text:"demander",strong:"G154",start:30,end:38}]},{number:25,text:"El entonces recost\xe1ndose sobre el pecho de Jes\xfas, d\xedcele: Se\xf1or, \xbfqui\xe9n es?",strong:[{text:"disciple",strong:"G3101",start:6,end:14},{text:"Seigneur",strong:"G2962",start:66,end:74}]},{number:26,text:"Respondi\xf3 Jes\xfas: Aqu\xe9l es, \xe1 quien yo diere el pan mojado. Y mojando el pan, di\xf3lo \xe1 Judas Iscariote, hijo de Sim\xf3n.",strong:[{text:"hijo",strong:"G5207",start:102,end:106}]},{number:27,text:"Y tras el bocado Satan\xe1s entr\xf3 en \xe9l. Entonces Jes\xfas le dice: Lo que haces, haz lo m\xe1s presto.",strong:[{text:"dans",strong:"H6887",start:42,end:46}]},{number:28,text:"Mas ninguno de los que estaban \xe1 la mesa entendi\xf3 \xe1 qu\xe9 prop\xf3sito le dijo esto.",strong:[{text:"ninguno",strong:"G3762",start:4,end:11},{text:"mesa",strong:"H7979",start:36,end:40},{text:"esto",strong:"G3778",start:74,end:78}]},{number:29,text:"Porque los unos pensaban, porque Judas ten\xeda la bolsa, que Jes\xfas le dec\xeda: Compra lo que necesitamos para la fiesta: \xf3, que diese algo \xe1 los pobres.",strong:[{text:"comme",strong:"G2531",start:32,end:37},{text:"dire",strong:"H559",start:79,end:83},{text:"besoin",strong:"H2637",start:111,end:117},{text:"donner",strong:"G1325",start:159,end:165}]},{number:30,text:"Como \xe9l pues hubo tomado el bocado, luego sali\xf3: y era ya noche.",strong:[{text:"Como",strong:"G2531",start:0,end:4},{text:"noche",strong:"G3571",start:58,end:63}]},{number:31,text:"Entonces, como \xe9l sali\xf3, dice Jes\xfas: Ahora es glorificado el Hijo del hombre, y Dios es glorificado en \xe9l.",strong:[{text:"como",strong:"G2531",start:10,end:14},{text:"Hijo",strong:"G5207",start:61,end:65},{text:"hombre",strong:"G444",start:70,end:76},{text:"Dios",strong:"G2316",start:80,end:84}]},{number:32,text:"Si Dios es glorificado en \xe9l, Dios tambi\xe9n le glorificar\xe1 en s\xed mismo, y luego le glorificar\xe1.",strong:[{text:"Dios",strong:"G2316",start:3,end:7},{text:"Dios",strong:"G2316",start:30,end:34}]},{number:33,text:"Hijitos, aun un poco estar\xe9 con vosotros. Me buscar\xe9is; mas, como dije \xe1 los Jud\xedos: Donde yo voy, vosotros no pod\xe9is venir; as\xed digo \xe1 vosotros ahora.",strong:[{text:"estar",strong:"G5463",start:21,end:26},{text:"como",strong:"G2531",start:61,end:65}]},{number:34,text:"Un mandamiento nuevo os doy: Que os am\xe9is unos \xe1 otros: como os he amado, que tambi\xe9n os am\xe9is los unos \xe1 los otros.",strong:[{text:"mandamiento",strong:"G1785",start:3,end:14},{text:"nuevo",strong:"G2537",start:15,end:20},{text:"como",strong:"G2531",start:56,end:60},{text:"amado",strong:"G27",start:67,end:72}]},{number:35,text:"En esto conocer\xe1n todos que sois mis disc\xedpulos, si tuviereis amor los unos con los otros.",strong:[{text:"esto",strong:"G3778",start:3,end:7},{text:"conocer",strong:"G1097",start:8,end:15},{text:"amor",strong:"G25",start:62,end:66}]},{number:36,text:"D\xedcele Sim\xf3n Pedro: Se\xf1or, \xbf\xe1 d\xf3nde vas? Respondi\xf3le Jes\xfas: Donde yo voy, no me puedes ahora seguir; mas me seguir\xe1s despu\xe9s.",strong:[{text:"Seigneur",strong:"G2962",start:22,end:30}]},{number:37,text:"D\xedcele Pedro: Se\xf1or, \xbfpor qu\xe9 no te puedo seguir ahora? mi alma pondr\xe9 por ti.",strong:[{text:"alma",strong:"G5590",start:59,end:63}]},{number:38,text:"Jes\xfas le respondi\xf3: \xbfTu alma pondr\xe1s por m\xed? De cierto, de cierto te digo: No cantar\xe1 el gallo, sin que me hayas negado tres veces.",strong:[{text:"alma",strong:"G5590",start:24,end:28}]}]},n=s}}]);
